const ProductReview = () => {
    const [products, setProducts] = useState([])

    useEffect(()=>{
        fetch(`http://localhost:4000/api/products`)
        .then(res => res.json())
        .then(data =>{
            try {
                if(data) setProducts(data)
                else throw new error(`sorry we have an issue`)
            } catch (error) {
                console.log(error)
            }
        })
    },[])



  return (
    <div className='container mx-auto pb-4 w-2/3'>
        <h2 className='text-white'> PRODUCTSSS</h2>
    </div>
  )
}

export default ProductReview
